import * as React from "react";
import { Box, Typography } from "@mui/material";

export default function VenuesPage() {
  return (
    <>
      {/* Grid Layout of 15 Boxes */}
      <Box
        sx={{
          display: "grid",
          gridTemplateColumns: "repeat(3, 1fr)", // 3 columns of equal width
          gridTemplateRows: "repeat(5, 30px)", // 5 rows, each with a height of 30px
          gap: 1, // Adds space between the boxes
          marginTop: 2,
        }}
      >
        {/* Creating 15 boxes (3 columns x 5 rows) */}
        {Array.from({ length: 15 }).map((_, index) => (
          <Box
            key={index}
            sx={{
              backgroundColor: "#ddd", // Light gray background for each box
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              border: "1px solid #ccc", // Light border for each box
            }}
          >
            <Typography variant="body2" sx={{ color: "#333" }}>
              Box {index + 1}
            </Typography>
          </Box>
        ))}
      </Box>
    </>
  );
}


